var logoData = "data:image/png;base64,";

Loading = cc.Scene.extend({
    _winSize : null,
    _interval : null,
    _label : null,
    _className:"LoaderScene",
    _logo: null,
    _logoTexture: null,    //logo
    cb: null,
    target: null,
    _bgLayer : null,
    _percent : 0,

    ctor : function() {
        this._super();
        this._winSize = cc.winSize;
    },
    init : function(){
        console.log("");
        var self = this;

        //logo 
        var logoWidth = 800;
        var logoHeight = 480;

        // bg
        var bgLayer = self._bgLayer = new cc.LayerColor(cc.color(32, 32, 32, 255));  //

        self.addChild(bgLayer, 0);

        this._logoTexture = new Image();

        this._logoTexture.addEventListener("load", function() {
            self._initStage(self._logoTexture, cc.visibleRect.center);
            console.log("");
        })

        this._logoTexture.src = logoData;
        this._logoTexture.width = 800;
        this._logoTexture.height = 480;

        var fontSize = 24,
            lblHeight =  -logoHeight / 2 + 100;
        fontSize = 14;
        lblHeight = -logoHeight / 2 - 10;


        //loading 
        var label = self._label = new cc.LabelTTF("Loading... 0%", "Arial", fontSize);
        label.setPosition(cc.visibleRect.center);
        label.setColor(cc.color(255, 0, 0));
        this._bgLayer.addChild(this._label, 10);
        return true;
    },

    _initStage: function (img, centerPos) {
        var self = this;
        var texture2d = self._texture2d = new cc.Texture2D();
        texture2d.initWithElement(img);
        texture2d.handleLoadedTexture();
        var logo = self._logo = new cc.Sprite(texture2d);
        logo.setScale(cc.contentScaleFactor());
        logo.x = centerPos.x;
        logo.y = centerPos.y;
        self._bgLayer.addChild(logo, 1);    //
    },

    onEnter: function () {
        var self = this;
        cc.Node.prototype.onEnter.call(self);
        self.schedule(self._startLoading, 0.2);     //0.2
    },

    onExit: function () {
        cc.Node.prototype.onExit.call(this);
        var tmpStr = "Loading... 0%";
        this._label.setString(tmpStr);
    },

    initWithResources: function (resources, cb, target) {
        if(cc.isString(resources))
            resources = [resources];
        this.resources = resources || [];
        this.cb = cb;
        this.target = target;
    },

    _startLoading: function () {
        var self = this;
        self.unschedule(self._startLoading);   //
        var res = self.resources;
        cc.loader.load(res,
            function (result, count, loadedCount) {
                var percent = (loadedCount / count * 100) | 0;
                self._percent = percent = Math.min(percent, 100);
                console.log(percent);                                       //
                self._label.setString("Loading... " + percent + "%");
            }, function () {
                if (self.cb) {
                    self.cb.call(self.target);
                }
            });
    }
});


Loading.preload = function(resources, cb, target){
    var _cc = cc;
    if(!_cc.loaderScene) {
        _cc.loaderScene = new Loading();
        _cc.loaderScene.init();
    }
    _cc.loaderScene.initWithResources(resources, cb, target);

    cc.director.runScene(_cc.loaderScene);
    return _cc.loaderScene;
};


